import styled from "styled-components";

const MainGallery = styled.ul`
  width: 304px;
  height: 200vw;
  overflow-y: scroll;
  display: grid;
  gap: 1px;
  box-sizing: border-box;
  grid-template-columns: repeat(3, 100px);
  grid-template-rows: ;
`;

const Photo = styled.li`
  background-color: var(--cream);
`;

function Main() {
  return (
    <div id="GlobalContainer">
      <MainGallery>
        <Photo />
      </MainGallery>
    </div>
  );
}

export default Main;
